import logo from './logo.svg';
import './App.css';

function MyButton(){
  const link="https://www.google.com"

  return(
    <button className="googlebutton">
      MyGoogleButton
    </button>
  )
}

function App() {
  const title = 'Welcome to the new blog';
  const likes = 50;
  return (
    <div className="App">
      <div className="content">
        <h1>{ title }</h1>
        <p>Liked { likes } times</p>
      </div>
    </div>
  );
}


export default App;
